import Game from 'components/game/Game';
import Board from 'features/layout/Board';
import GameFooter from 'features/layout/Footer';
import TheirBoard from 'features/layout/TheirBoard';
import YourBoard from 'features/yourBoard/YourBoard';
import TheirHand from 'features/yourHand/TheirHand';
import YourHand from 'features/yourHand/YourHand';

export default () => {
  return (
    <Game>
      <TheirHand />
      <Board>
        <TheirBoard />
        <YourBoard />
      </Board>
      <YourHand />
    </Game>
  );
};
